rawContent:
IT'S ALWAYS CUTTER'S FAULT

day starts out on a wide open par 5 
@bPardini10 sprays way right, Mitch hooks way left;
these guys split me like a $10 whore

@bPardini10 is skulling wedges and Mitch is lipping out putts and I'm feeling about as helpful as a fart in a spacesuit

11 holes in and @bPardini has had more shots than a Jason Aldean concert

@bPardini10 finally finds the proper b/a level and he's striping his long irons, but he's griping that I don't keep his putter cover on.  Jesus Christ @bPardini...it's not a Scotty!

In all honesty, a super fun day at a beautiful course. These guys might not have brought their A game, but we had a lot of laughs and I'm looking forward to doing it again...THANKS GUYS! 😃💪👏
